// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/math/SafeMath.sol";

interface GatekeeperOne{
    function enter(bytes8) external returns (bool);
}

contract Hak {


  using SafeMath for uint256;
  address public entrant;
  address public owner;
  address hisAddr = 0xdBc7c99fE6B538631473060E8C2FBA627611d635;

  GatekeeperOne gone = GatekeeperOne(hisAddr);


    function getGasLeft()public view returns(uint) {
        return gasleft();
    }

        function isEqualGasLeft(uint  _kk) public view returns(bool, uint){
        return (_kk == gasleft(), gasleft());
    }

  function isGateTwo()public view returns(bool) {
        return gasleft().mod(8191) == 0;
    }

    function isReallyGateTwo(uint _het)public view returns(bool) {
        return _het.mod(8191) == 0;
    }


    function call(bytes8 _jma)public returns(uint){
        return (gasleft());
    }
  receive() external payable{}
  fallback() external payable{}

  /*modifier gateThree(bytes8 _gateKey) {
      require(uint32(uint64(_gateKey)) == uint16(uint64(_gateKey)), "GatekeeperOne: invalid gateThree part one");
      require(uint32(uint64(_gateKey)) != uint64(_gateKey), "GatekeeperOne: invalid gateThree part two");
      require(uint32(uint64(_gateKey)) == uint16(uint160(tx.origin)), "GatekeeperOne: invalid gateThree part three");
    _;
  }

  function enter(bytes8 _gateKey) public gateOne gateTwo gateThree(_gateKey) returns (bool) {
    entrant = tx.origin;
    return true;
  }*/
}

